  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:11.638888\",\n\t\"name\": \"mingo-national-wildlife-refuge-contaminants-survey-results\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fishes and turtles were collected from
  Stanley and Linn Creeks, Ditches 1 and 2, and Mingo Ditch of Mingo National Wildlife
  Refuge (MNWR) near Puxico, Stoddard and Wayne Counties, Missouri. Whole fish samples
  and turtle livers were analyzed for various metal and organic contaminants to determine
  if concentrations were elevated in the biota located on the refuge. Results were
  compared to the literature and potential contaminant problems were recognized. Concentrations
  of mercury and copper either exceeded or were the same as concentrations in the
  literature where adverse effects to biota were reported. However, the limited number
  of samples collected at MNWR and differing tissue types analyzed may demonstrate
  the reason for the apparent concentrations of concern. If concern is shown for populations
  of fish and wildlife resources using MNWR because of decreasing numbers or health,
  further investigations into these compounds should be initiated.\",\n\t\"license_title\":
